bf_drv_client_handle_t bf_drv_hdl;

static void build_pd_res_spec(pipe_action_spec_t *action_spec,
                              pd_res_spec_t **res_spec,
                              int *resource_cnt) {
  if (action_spec->resource_count) {
    *res_spec = bf_sys_calloc(action_spec->resource_count,
                              sizeof(pd_res_spec_t));
    unsigned i = 0;
    int idx = 0;
    for (i = 0; i < action_spec->resource_count; i++) {
      if (action_spec->resources[i].tag == PIPE_RES_ACTION_TAG_ATTACHED) {
        (*res_spec)[idx].tbl_hdl = action_spec->resources[i].tbl_hdl;
        (*res_spec)[idx].tbl_idx = action_spec->resources[i].tbl_idx;
        idx++;
      }
    }
    *resource_cnt = idx;
  } else {
    *resource_cnt = 0;
  }
  return;
}



static p4_pd_ms_table_state_t *ms_bd_action_profile_state;
static p4_pd_ms_table_state_t *ms_lag_action_profile_state;
static p4_pd_ms_table_state_t *ms_ecmp_action_profile_state;

static bf_status_t p4_pd_dc_dev_remove(bf_dev_id_t dev_id) {

  p4_pd_ms_destroy_state_for_dev(ms_bd_action_profile_state, dev_id); 
  p4_pd_ms_destroy_state_for_dev(ms_lag_action_profile_state, dev_id); 
  p4_pd_ms_destroy_state_for_dev(ms_ecmp_action_profile_state, dev_id); 
  p4_pd_ms_destroy_txn_state_for_dev(dev_id);
  return BF_SUCCESS;
}

static bf_status_t p4_pd_dc_dev_log(bf_dev_id_t dev_id, cJSON *pd_node) {
  cJSON *profs, *prof;
  cJSON_AddStringToObject(pd_node, "name", "switch");
  cJSON_AddItemToObject(pd_node, "act_profs", profs = cJSON_CreateArray());

  cJSON_AddItemToArray(profs, prof = cJSON_CreateObject());
  cJSON_AddStringToObject(prof, "name", "bd_action_profile");
  p4_pd_ms_log_state(dev_id, ms_bd_action_profile_state, prof);

  cJSON_AddItemToArray(profs, prof = cJSON_CreateObject());
  cJSON_AddStringToObject(prof, "name", "lag_action_profile");
  p4_pd_ms_log_state(dev_id, ms_lag_action_profile_state, prof);

  cJSON_AddItemToArray(profs, prof = cJSON_CreateObject());
  cJSON_AddStringToObject(prof, "name", "ecmp_action_profile");
  p4_pd_ms_log_state(dev_id, ms_ecmp_action_profile_state, prof);

  return BF_SUCCESS;
}

static bf_status_t p4_pd_dc_dev_restore(bf_dev_id_t dev_id, cJSON *pd_node) {
  cJSON *profs, *prof;

  profs = cJSON_GetObjectItem(pd_node, "act_profs");
  for (prof = profs->child; prof; prof = prof->next) {

    if (strcmp(cJSON_GetObjectItem(prof, "name")->valuestring, "bd_action_profile") == 0) {
      p4_pd_ms_restore_state(dev_id, ms_bd_action_profile_state, prof);
    }

    if (strcmp(cJSON_GetObjectItem(prof, "name")->valuestring, "lag_action_profile") == 0) {
      p4_pd_ms_restore_state(dev_id, ms_lag_action_profile_state, prof);
    }

    if (strcmp(cJSON_GetObjectItem(prof, "name")->valuestring, "ecmp_action_profile") == 0) {
      p4_pd_ms_restore_state(dev_id, ms_ecmp_action_profile_state, prof);
    }
  }

  return BF_SUCCESS;
}

void p4_pd_dc_init(void) {
  p4_pd_ms_init();

  ms_bd_action_profile_state = p4_pd_ms_init_state();
  ms_lag_action_profile_state = p4_pd_ms_init_state();
  ms_ecmp_action_profile_state = p4_pd_ms_init_state();
  bf_status_t r = bf_drv_register("p4_pd_dc_pd", &bf_drv_hdl);
  assert(r == BF_SUCCESS);
  bf_drv_client_callbacks_t callbacks = {0};
  callbacks.device_del = p4_pd_dc_dev_remove;
  callbacks.device_log = p4_pd_dc_dev_log;
  callbacks.device_restore = p4_pd_dc_dev_restore;
  bf_drv_client_register_callbacks(bf_drv_hdl, &callbacks, BF_CLIENT_PRIO_2);
}

void p4_pd_dc_device_state_cleanup(uint8_t device_id) {
  p4_pd_ms_destroy_state_for_dev(ms_bd_action_profile_state, device_id);
  p4_pd_ms_destroy_state_for_dev(ms_lag_action_profile_state, device_id);
  p4_pd_ms_destroy_state_for_dev(ms_ecmp_action_profile_state, device_id);
}

void p4_pd_dc_cleanup(void) {

  p4_pd_ms_cleanup();

  bf_drv_deregister(bf_drv_hdl);
}

