p4_pd_status_t
p4_pd_dc_bd_action_profile_get_member
(
 p4_pd_sess_hdl_t sess_hdl,
 uint8_t dev_id,
 p4_pd_mbr_hdl_t mbr_hdl,
 bool read_from_hw,
 p4_pd_dc_action_specs_t *action_spec
)
{
  (void)sess_hdl;

  p4_pd_act_hdl_t act_fn_hdl;

  pipe_action_data_spec_t pipe_action_data_spec;
  uint8_t pipe_action_data_bits[sizeof(p4_pd_dc_action_specs_t)];
  memset(pipe_action_data_bits, 0, sizeof(p4_pd_dc_action_specs_t));
  pipe_action_data_spec.action_data_bits = pipe_action_data_bits;
  pipe_action_data_spec.num_action_data_bytes = sizeof(p4_pd_dc_action_specs_t);

  p4_pd_status_t status = pipe_mgr_get_action_data_entry(33554437,
                              dev_id,
                              mbr_hdl,
                              &pipe_action_data_spec,
                              &act_fn_hdl,
                              read_from_hw);
  if (status != PIPE_MGR_SUCCESS) {
    return status;
  }

  pd_res_spec_t *res_spec = NULL;
  int resource_cnt = 0;
  (void) res_spec;
  (void) resource_cnt;

  switch(act_fn_hdl) {
  case 536870971:
    action_spec->name = p4_pd_dc_set_bd_properties;
    p4_pd_ms_mbr_get_res(ms_bd_action_profile_state,
                         dev_id,
                         mbr_hdl,
                         &resource_cnt,
                         &res_spec);

    unbuild_action_spec_set_bd_properties(&pipe_action_data_spec,
                          res_spec,
                          resource_cnt,
                          &action_spec->u.p4_pd_dc_set_bd_properties);
    break;
  case 536870973:
    action_spec->name = p4_pd_dc_port_vlan_mapping_miss;
    break;
  default:
    assert(NULL);
    break;
  }
  return status;
}

