p4_pd_status_t
p4_pd_dc_hash_calc_lag_hash_input_field_attribute_set
(
 p4_pd_sess_hdl_t sess_hdl,
 uint8_t dev_id,
 p4_pd_dc_lag_hash_input_t input,
 uint32_t attr_count,
 p4_pd_dc_lag_hash_input_field_attribute_t *array_of_attrs
)
{
  bf_status_t status = BF_SUCCESS;
  pipe_sel_tbl_hdl_t field_list_hdl = 0, curr_field_list_hdl = 0;
  int i = 0, all_field_attr_count = 0;
  uint64_t field_bitmap = 0, all_field_bitmap = 0, temp = 0;
  bool curr_fl_validated = false;

  /* Validate that field-list being changed is already set */
  status = pipe_mgr_hash_calc_input_get(sess_hdl, dev_id, 570425346, &curr_field_list_hdl);
  if (status != BF_SUCCESS) {
    return status;
  }
  /* Create a bitmap of all input fields specified,
     Create another bitmap of included input fields
  */
  for (i=0; i< attr_count; i++) {
    all_field_bitmap |= (1<< array_of_attrs[i].input_field.id);
    if ((array_of_attrs[i].type == P4_PD_INPUT_FIELD_ATTR_TYPE_MASK) &&
        (array_of_attrs[i].value.val == P4_PD_INPUT_FIELD_INCLUDED)) {
      field_bitmap |= (1<< array_of_attrs[i].input_field.id);
    }
  }
  /* Count total field list atributes */
  for (temp = all_field_bitmap; temp != 0; temp = temp >> 1) {
    all_field_attr_count++;
  }
  if (P4_PD_DC_LAG_HASH_INPUT_LAG_HASH_FIELDS == input) {
    char exp_bitmap[1+1];
    memset(exp_bitmap, 0, sizeof(exp_bitmap));
    /* Enum val is same for all field-list combinations, but hdl is different */
    if (553648130 == curr_field_list_hdl) {
      curr_fl_validated = true;
    }
    /* All attributes need to be specified by user */
    if (all_field_attr_count != 1) {
      return BF_INVALID_ARG;
    }
    int len = 0;
    /* Create bitmap string of field-list attributes */
    for (i=1-1; i >= 0; i--) {
      if (field_bitmap & (0x1 << i)) {
        len += snprintf(exp_bitmap + len, 1+1, "%s", "1");
      } else {
        len += snprintf(exp_bitmap + len, 1+1, "%s", "0");
      }
    }
    char *fl_bitmap = "1";
    /* Compare bitmap created with that in this field-list combination */
    int res = strncmp(exp_bitmap, fl_bitmap, strlen(exp_bitmap));
    if (res == 0) {
      field_list_hdl = 553648130;
    }
  }
  /* Make sure requested field-list is currently active */
  if (!curr_fl_validated) {
    return BF_INVALID_ARG;
  }
  return pipe_mgr_hash_calc_input_set(sess_hdl, dev_id, 570425346, field_list_hdl);
}

