p4_pd_status_t
p4_pd_dc_hash_calc_lkp_ipv4_hash1_algorithm_set
(
 p4_pd_sess_hdl_t sess_hdl,
 uint8_t dev_id,
 p4_pd_dc_lkp_ipv4_hash1_algo_t algo
)
{
  pipe_sel_tbl_hdl_t algorithm_hdl = 0;
  if (P4_PD_DC_LKP_IPV4_HASH1_ALGORITHM_CRC_16_DECT == algo) {
    algorithm_hdl = 587202563;
  }
  if (P4_PD_DC_LKP_IPV4_HASH1_ALGORITHM_CRC16 == algo) {
    algorithm_hdl = 587202564;
  }
  if (P4_PD_DC_LKP_IPV4_HASH1_ALGORITHM_CRC_16_GENIBUS == algo) {
    algorithm_hdl = 587202565;
  }
  if (P4_PD_DC_LKP_IPV4_HASH1_ALGORITHM_CRC_16_DNP == algo) {
    algorithm_hdl = 587202566;
  }
  if (P4_PD_DC_LKP_IPV4_HASH1_ALGORITHM_CRC_16_TELEDISK == algo) {
    algorithm_hdl = 587202567;
  }
  return pipe_mgr_hash_calc_algorithm_set(sess_hdl, dev_id, 570425349,
          algorithm_hdl);
}

p4_pd_status_t
p4_pd_dc_hash_calc_lkp_ipv4_hash1_algorithm_get
(
 p4_pd_sess_hdl_t sess_hdl,
 uint8_t dev_id,
 p4_pd_dc_lkp_ipv4_hash1_algo_t *algo
)
{
  bf_status_t status = BF_SUCCESS;
  pipe_sel_tbl_hdl_t algorithm_hdl = 0;

  status = pipe_mgr_hash_calc_algorithm_get(sess_hdl, dev_id, 570425349,
          &algorithm_hdl);
  if (587202563 == algorithm_hdl) {
    *algo = P4_PD_DC_LKP_IPV4_HASH1_ALGORITHM_CRC_16_DECT;
    return status;
  }
  if (587202564 == algorithm_hdl) {
    *algo = P4_PD_DC_LKP_IPV4_HASH1_ALGORITHM_CRC16;
    return status;
  }
  if (587202565 == algorithm_hdl) {
    *algo = P4_PD_DC_LKP_IPV4_HASH1_ALGORITHM_CRC_16_GENIBUS;
    return status;
  }
  if (587202566 == algorithm_hdl) {
    *algo = P4_PD_DC_LKP_IPV4_HASH1_ALGORITHM_CRC_16_DNP;
    return status;
  }
  if (587202567 == algorithm_hdl) {
    *algo = P4_PD_DC_LKP_IPV4_HASH1_ALGORITHM_CRC_16_TELEDISK;
    return status;
  }
  return BF_INVALID_ARG;
}

